// Given a string, find the length of the longest substring without repeating characters.
// Examples:
// Given "abcabcbb", the answer is "abc", which the length is 3.
//
// Given "bbbbb", the answer is "b", with the length of 1.
//
// Given "pwwkew", the answer is "wke", with the length of 3.
// Note that the answer must be a substring, "pwke" is a subsequence
// and not a substring.

let lengthOfLongestSubstring = function (s) {
  let longest = "";
  let mostRecentWindowIndex = {};
  for (let i = 0; i < s.length; i++) {
    for (let j = i + 1 + longest.length; j < s.length + 1; j++) {
      let subString = s.slice(i, j);
      mostRecentWindowIndex[s[j]] = j;
      let valid = validSubString(subString);
      if (!valid) {
        i = mostRecentWindowIndex[s[j]];
      }
      if (valid && subString.length > longest.length) {
        longest = subString;
      }
    }
  }
  return longest.length;
};

let validSubString = function (sub) {
  let comp = "";
  let chars = new Set();
  for (let i = 0; i < sub.length; i++) {
    if (chars.has(sub[i])) {
      return false;
    } else {
      chars.add(sub[i]);
      comp += sub[i];
    }
  }
  return true;
};

console.log(lengthOfLongestSubstring("abcabcbb")); // abc
console.log(lengthOfLongestSubstring("bbbbb")); // b
console.log(lengthOfLongestSubstring("pwwkew")); // wke
console.log(lengthOfLongestSubstring("c")); // c
